import React from "react";
import CatCard from "./CatCard";

function MatchPage({matched, setMatch}) {

    return (
        <div>
              {matched.map((cat) => (
                          <CatCard 
                              id={cat.id}
                              image={cat.url}
                              name={cat.name}
                              favoritemovie={cat.favoriteMovie}
                              age={cat.age}
                              pickupLine={cat.pickupLine}
                              matched={matched} 
                              setMatch={setMatch}
                          />
          ))}
        </div>
    ) 
}

export default MatchPage
